import "./App.css";
import Home from "./components/Home";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <>
    <Router></Router>
       <Switch>
          <Route path="Home">
            <Home />
          </Route>
          
        </Switch>


      {/* <Home Home={Home} /> */}
    </>
  );
}

export default App;
